import React from "react";
import {
	AppBar,
	Toolbar,
	IconButton,
	Icon,
	Typography,
	Stack,
} from "@mui/material";

function Navbar() {
	return (
		<AppBar position="static">
			<Toolbar>
				<IconButton
					size="large"
					edge="start"
					color="inherit"
					aria-label="logo"
				>
					<div>Logo</div>
				</IconButton>
				<Typography
					variant="h6"
					component="div"
					sx={{ flexGrow: 1 }}
				>
					Test App
				</Typography>
				<Stack></Stack>
			</Toolbar>
		</AppBar>
	);
}

export default Navbar;
